"""**Exercise # 1: Dijkstra’s Algorithm**

(a)	Write a function named getShortestPath (graph, from, to) that takes a graph as an input and estimates the shortest distance between a node “from” to a node “to”.

![lab_11_a.png](data:image/png;base64,)
"""

# Solution to Exercise 1 (a)

G = {
 'A': [('B', 5), ('E', 6), ('D', 3)],
 'B': [('A', 5), ('C', 6)],
 'C': [('B', 6), ('D', 10), ('G', 2)],
 'D': [('A', 2), ('C', 10), ('F', 8)],
 'E': [('A', 6), ('F', 9)],
 'F': [('D', 8), ('E', 9), ('G', 10)],
 'G': [('C', 2), ('F', 10)]
 }

def Dijkstra(graph, source):
  dist = {}
  dist[source] = [source, 0]
  for vertex in graph:
      if vertex != source:
          dist[vertex] = ['-', 1000000000000000000]

  visited = []
  while len(visited) != len(dist):
    min_cost = 1000000000000000000
    for node in dist:
      if node not in visited and dist[node][1] < min_cost:
        min_node = node
        min_cost = dist[node][1]
    visited.append(min_node)
    for neighbor in graph[min_node]:
      cost = dist[min_node][1] + neighbor[1]
      if dist[neighbor[0]][1] > cost:
        dist[neighbor[0]][1] = cost
        dist[neighbor[0]][0] = min_node
  return dist

# print(Dijkstra(G, 'A'))

def getShortestPath(graph, source, to):
  path = []
  dist = Dijkstra(G, source)
  node = dist[to][0]
  path.append((node, to))
  while node != source:
    n_node = dist[node][0]
    path.append((n_node, node))
    node = n_node
  return path[::-1]

print("The shortest path from A to G is", getShortestPath(G, "A", "G"))

"""**(b)**	You are given a CSV file that contains a list of different cities in northern areas of Pakistan and their distances. Not all of the cities are directly connected which is represented by -1 in the distance matrix.

i.	Load the given dataset in the form of a graph (adjacency list)

ii.	Estimate the shortest distance between Islamabad and Kaghan.

"""

# Solution to Exercise 1 (b)
import csv

lines = []
nodes, edges = [], []
temp = {}
G = {}

with open('connections.csv', 'r') as file:
  my_reader = csv.reader(file, delimiter = ',')
  # print(my_reader)
  for line in my_reader:
    lines.append(line)
  # print(lines)
  for i in range(1, len(lines[0])):
    temp[i] = lines[0][i]
    nodes.append(lines[0][i])
  # print(temp)
  # print(nodes)
  for i in range(1, len(lines)):
    for j in range(1, len(lines[0])):
      if lines[i][j] != '0' and lines[i][j] != '-1':
        edges.append((temp[i], temp[j], int(lines[i][j])))
  # print(nodes)
  # print(edges)
  addNodes(G, nodes)
  addEdges(G, edges, True)
# print(G)
print("The dataset can be represented in the form of a graph with connections as: ")
displayGraph(G)

print("\n")

print("The shortest distance from Islamabad to Kaghan is by ", getShortestPath(G, "Islamabad", "Kaghan"))

